if mibBuilder.loadTexts: esmPortCfgPause.setDescription('This object is used to configure the default administrative PAUSE mode for this interface. This object represents the administratively-configured PAUSE mode for this interface. If auto-negotiation is not enabled or is not implemented for the active MAU attached to this interface, the value of this object determines the operational PAUSE mode of the interface whenever it is operating in full-duplex mode. In this case, a set to this object will force the interface into the specified mode. If auto-negotiation is implemented and enabled for the MAU attached to this interface, the PAUSE mode for this interface is determined by auto-negotiation, and the value of this object denotes the mode to which the interface will automatically revert if/when auto-negotiation is later disabled. For more information on what pause values will be autonegotiated based on settings on this object, please refer to the truth table in the users manual. Note that the value of this object is ignored when the interface is not operating in full-duplex mode.')
